const YearFilter = () => {
    return (
        <form>
            <div>
                <label>Select Year</label>
                <select>
                    <option>2020</option>
                    <option>2021</option>
                    <option>2022</option>
                    <option>2023</option>
                </select>
            </div>
        </form>
    )
}
export default YearFilter;
